onfig_file)\n\n# Get client\nclient = Deisa.get_client()\n\n# either: Get data descriptor as a list of Deisa arrays object\narrays = Deisa.get_deisa_arrays()\n# or: Get data descriptor as a dict of Dask array\n# arrays = Deisa.get_dask_arrays()\n\n# Select data\ngt = arrays[\"global_t\"][...]\nprint(gt, flush=True)\n\n# Check contract\narrays.check_contract()\narrays.validate_contract()\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    results = []\n    for i in range(25):\n        \n        cpt = np.sum(gt[i])\n\n        s = client.persist(cpt, release=True)\n\n        results.append(client.compute(s))\n\n    del gt\n\n# Write the results\nwith open(\"results.log\", \"a\") as f:\n    result = [cpt.result() for cpt in results]\n    f.write(str(result))\n\nprint(\"{:&lt;21}\".format(\"EST_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"tools":[{"id":"1056"},{"id":"1057"},{"id":"1058"},{"id":"1059"},{"id":"1072"}]},"id":"1061","type":"Toolbar"},{"attributes":{"data":{"cpu":{"__ndarray__":"AAAAAAAAOEAAAAAAAAAsQAAAAAAAACBAAAAAAAAAEEAAAAAAAAA4QAAAAAAAAChAAAAAAAAAEEAAAAAAAAAQQAAAAAAAADZAAAAAAAAAJEAAAAAAAAAYQAAAAAAAACBAAAAAAAAAPEAAAAAAAAAyQAAAAAAAABhAAAAAAAAAIEAAAAAAAAA6QAAAAAAAADJAAAAAAAAAGEAAAAAAAAA2QM3MzMzMDEZAzczMzMwsWUA=","dtype":"float64","order":"little","shape":[22]},"memory":[110145536,110149632,110157824,110157824,110157824,110157824,110157824,110157824,110178304,110256128,110256128,110346240,110530560,110751744,110960640,111218688,111673344,111902720,111902720,112496640,115634176,126615552],"num_fds":[397,397,397,397,397,397,397,397,397,397,397,397,397,397,397,397,397,397,397,397,637,638],"read_bytes":{"__ndarray__":"hT7smbKYB0G+k62oPJbpQJM3LmLIxslA/8U9PTRFjEBBNyms3+oFQbno3DSr0+JAMBFBu/sS0UAYo29d1liYQGD5UDZ4WwdBdqheeNgb3UAk0xSG8R/NQP+X3vvV3PtA
